interface Proyecto {
    title: string;
    description: string;
}

interface TarjetasProps {
    proyectos: Proyecto[]; 
}

const Tarjeta: React.FC<Proyecto> = ({ title, description }) => {
    return (
        <div className="project-card">
          <h2>{title}</h2>
          <p>{description}</p>  
        </div>
    );    
};

export default Tarjeta;
